import { Component } from "react";

const styles = {
  carro: {
    fontWeight: "700",
    fontSize: "25px",
  },
};

class Carro extends Component {
  render() {
    return (
      <div>
        <button style={styles.carro}>Carro</button>
      </div>
    );
  }
}

export default Carro;
